package com.factorit.challenge.utils;

import com.factorit.challenge.model.ClientUser;
import com.factorit.challenge.model.Product;
import com.factorit.challenge.model.SpecialDate;
import com.factorit.challenge.repository.ClientUserRepository;
import com.factorit.challenge.repository.ProductRepository;
import com.factorit.challenge.repository.SpecialDateRepository;
import lombok.RequiredArgsConstructor;
import lombok.extern.slf4j.Slf4j;
import org.apache.tomcat.util.codec.binary.Base64;
import org.springframework.boot.ApplicationArguments;
import org.springframework.boot.ApplicationRunner;
import org.springframework.stereotype.Component;

import java.math.BigDecimal;
import java.time.LocalDate;
import java.time.MonthDay;
import java.time.YearMonth;
import java.util.ArrayList;
import java.util.HashSet;

@Component
@Slf4j
@RequiredArgsConstructor
public class DatabaseSeeder implements ApplicationRunner {
    private final ClientUserRepository userRepository;
    private final ProductRepository productRepository;
    private final SpecialDateRepository specialDateRepository;

    @Override
    public void run(ApplicationArguments args) {
        userRepository.save(new ClientUser(null, "Juan", "Perez", new ArrayList<>(), LocalDate.EPOCH,false, YearMonth.of(2023,1)));
        userRepository.save(new ClientUser(null, "Andres", "Hoyos Garcia", new ArrayList<>(), LocalDate.EPOCH,true, YearMonth.of(2023,5)));
        userRepository.save(new ClientUser(null, "Abdul", "Salam", new ArrayList<>(), LocalDate.EPOCH,false, YearMonth.of(2023,2)));
        userRepository.save(new ClientUser(null, "John", "Doe", new ArrayList<>(), LocalDate.EPOCH,false, YearMonth.of(2023,6)));

        String mouseB64 = "";
        String tecladoB64 = "";
        String auricularesB64 = "";
                String monitorB64 = "";
                String microfonoB64 = "";
            String camaraB64 = "";
            String sillaB64 = "";
            String escritorioB64 = "";

                productRepository.save(new Product(null, "Mouse", BigDecimal.valueOf(500.00),new HashSet<>(), Base64.decodeBase64(mouseB64)));
        productRepository.save(new Product(null, "Teclado", BigDecimal.valueOf(300.00),new HashSet<>(), Base64.decodeBase64(tecladoB64)));
        productRepository.save(new Product(null, "Auriculares", BigDecimal.valueOf(400.00),new HashSet<>(), Base64.decodeBase64(auricularesB64)));
        productRepository.save(new Product(null, "Monitor", BigDecimal.valueOf(1000.00),new HashSet<>(), Base64.decodeBase64(monitorB64)));
        productRepository.save(new Product(null, "Microfono", BigDecimal.valueOf(100.00),new HashSet<>(), Base64.decodeBase64(microfonoB64)));
        productRepository.save(new Product(null, "Camara web", BigDecimal.valueOf(150.00),new HashSet<>(), Base64.decodeBase64(camaraB64)));
        productRepository.save(new Product(null, "Silla", BigDecimal.valueOf(2000.00),new HashSet<>(), Base64.decodeBase64(sillaB64)));
        productRepository.save(new Product(null, "Escritorio", BigDecimal.valueOf(1500.00),new HashSet<>(), Base64.decodeBase64(escritorioB64)));

        specialDateRepository.save(new SpecialDate(null, MonthDay.of(12,24)));
        specialDateRepository.save(new SpecialDate(null, MonthDay.of(12,31)));
        specialDateRepository.save(new SpecialDate(null, MonthDay.of(1,1)));
        specialDateRepository.save(new SpecialDate(null, MonthDay.of(5,25)));
        specialDateRepository.save(new SpecialDate(null, MonthDay.of(7,9)));

        log.info("Database seeded successfully!");
    }
}
